Release date: Sept 6, 2013
Summer Vengeance Season 10

All season long these two have had an ongoing love hate relationship. Penny has been relentless on trying to push Syd's buttons during the tag matches. Pennys big mouth is gonna need some back up today. There are no team mates to blame if she loses today. It's one on one. The match you've all been waiting for. Will Penny's size help her today. Will all the trash talking get into Syd's head and make her fight with emotions rather than skill? 

Lots of fingering on the mats in this match. Two orgasms and some submissions. This match is all over the place. 
